import React, { useContext } from "react";
import "./Portfolio.css";
import { Swiper, SwiperSlide } from "swiper/react";
import "swiper/css";
import video1 from "../../img/video1.mp4";
import video2 from "../../img/video2.mp4";
import video3 from "../../img/video3.mp4";
import video4 from "../../img/video4.mp4";
import { themeContext } from "../../Context";

const Portfolio = () => {
  const theme = useContext(themeContext);
  const darkMode = theme.state.darkMode;

  return (
    <div className="portfolio" id="portfolio">
      {/* heading */}
      <span style={{ color: darkMode ? 'white' : '' }}>Recent Projects</span>
      <span>Portfolio</span>

      {/* slider */}
      <Swiper
        spaceBetween={30}
        slidesPerView={3}
        grabCursor={true}
        className="portfolio-slider"
      >
        <SwiperSlide>
          <div className="portfolio-item">
            <video src={video1} controls />
            <a href="../../img/video1.mp4" target="_blank" rel="noopener noreferrer" className="portfolio-link">View Project</a>
          </div>
        </SwiperSlide>
        <SwiperSlide>
          <div className="portfolio-item">
            <video src={video2} controls />
            <a href="https://example.com/video2" target="_blank" rel="noopener noreferrer" className="portfolio-link">View Project</a>
          </div>
        </SwiperSlide>
        <SwiperSlide>
          <div className="portfolio-item">
            <video src={video3} controls />
            <a href="https://example.com/video3" target="_blank" rel="noopener noreferrer" className="portfolio-link">View Project</a>
          </div>
        </SwiperSlide>
        <SwiperSlide>
          <div className="portfolio-item">
            <video src={video4} controls />
            <a href="../../img/video4.mp4" target="_blank" rel="noopener noreferrer" className="portfolio-link">View Project</a>
          </div>
        </SwiperSlide>
      </Swiper>
    </div>
  );
};

export default Portfolio;
